import React, { useState } from "react";

const Home = () => {
  const [location, setLocation] = useState("");
  const [startDate, setStartDate] = useState("");
  const [endDate, setEndDate] = useState("");

  return (
    <div
      className="relative h-[92vh] bg-cover bg-center flex items-center justify-center"
      style={{
        backgroundImage: `url('https://images.pexels.com/photos/106399/pexels-photo-106399.jpeg')`,
      }}
    >
      {/* Dark Overlay */}
      <div className="absolute inset-0 bg-black/50"></div>

      {/* Content Section */}
      <div className="relative text-white text-center max-w-2xl px-6">
        
        <h1 className="text-5xl font-bold drop-shadow-md mb-4">
          Your Property, Our Priority
        </h1>

        <p className="text-lg md:text-xl opacity-90 mb-6">
          Find the perfect home, apartment, or luxury farmhouse today.
        </p>

        {/* Label Above Search Box */}
        <h2 className="text-2xl font-semibold mb-3">Find My Property üîç</h2>

        {/* Search Bar Box */}
        <div className="backdrop-blur-md bg-white/20 p-4 rounded-lg shadow-lg flex flex-col md:flex-row md:items-center gap-4">

          {/* Location Input */}
          <input
            type="text"
            placeholder="Enter Location..."
            value={location}
            onChange={(e) => setLocation(e.target.value)}
            className="border border-white/30 bg-white/80 text-black placeholder-gray-600 rounded p-2 w-full md:w-48"
          />

          {/* Start Date */}
          <input
            type="date"
            value={startDate}
            onChange={(e) => setStartDate(e.target.value)}
            className="border border-white/30 bg-white/80 text-black rounded p-2 w-full md:w-48"
          />

          {/* End Date */}
          <input
            type="date"
            value={endDate}
            onChange={(e) => setEndDate(e.target.value)}
            className="border border-white/30 bg-white/80 text-black rounded p-2 w-full md:w-48"
          />

          {/* Search Button */}
          <button className="bg-blue-600 hover:bg-blue-700 text-white px-6 py-2 rounded transition-all">
            Search
          </button>
        </div>
      </div>
    </div>
  );
};

export default Home;
